export class TestPaletteProvider {
    constructor(bpmnFactory, create, elementFactory, palette, translate) {
        console.log('--late', palette)
        this.bpmnFactory = bpmnFactory;
        this.create = create;
        this.elementFactory = elementFactory;
        this.translate = translate;
        palette.registerProvider(this);
    }

    getPaletteEntries(element) {
        const {
            bpmnFactory,
            create,
            elementFactory,
            translate
          } = this;
      
          function createTask(suitabilityScore) {
            return function(event) {
              const businessObject = bpmnFactory.create('bpmn:Task');
      
              businessObject.suitable = suitabilityScore;
      
              const shape = elementFactory.createShape({
                type: 'bpmn:Task',
                businessObject: businessObject
              });
      
              create.start(event, shape);
            };
          }
        return {
            'create.low-task': {
                group: 'activity',
                className: 'bpmn-icon-task red',
                title: 'Create Task with low suitability score',
                action: {
                    dragstart: createTask(90),
                    click: createTask(90)
                }
            }
        };
    }
}
TestPaletteProvider.$inject = [
    'bpmnFactory',
    'create',
    'elementFactory',
    'palette',
    'translate'
];

export default {
    __init__: ["testPaletteProvider"],
    testPaletteProvider: ["type", TestPaletteProvider]
};
